import React, { Component } from 'react';
import Add_team from './Add_team';
import '../../App.css';

export default class Not_member extends Component {

    teamCreation() {
        console.log("creation team");
    }

    render() {
        return (
            <div className='team'>
                Vous n'êtes pas encore membre d'une équipe.
                <div>
                    <button className='btn-team' onClick={this.teamCreation}>Créer une équipe</button>
                    <button className='btn-team' onClick={this.joinTeam}>Rejoindre une équipe</button>
                </div>
            </div>
        )
    }
}
